import React from "react";
import styled from "styled-components";

const Slogan_block = styled.div`
  width: 60vw;
  height: 100vh;
  background: white;
  margin-left: 20vw;
`;

function Slogan_Template({ children }) {
  return <Slogan_block>{children}</Slogan_block>;
}

export default Slogan_Template;
